import { createElement as $, useState } from 'react';
import { Menu } from 'antd';
import {
	MailOutlined,
	AppstoreOutlined,
	SettingOutlined,
} from '@ant-design/icons';

const { SubMenu, Item, ItemGroup } = Menu;

const Header = () => {
	const [current, setCurrent] = useState('mail');

	const handleClick = (e) => {
		console.log('click ', e);
		setCurrent({ current: e.key });
	};

	return $(
		Menu,
		{
			onClick: handleClick,
			selectedKeys: current,
			mode: 'horizontal',
		},
		$(Item, { key: 'mail', icon: MailOutlined }, 'Navigation One'),
		$(
			SubMenu,
			{ title: 'SubMenu', icon: MailOutlined },
			$(Item, { key: 'set1' }, 'Option One'),
			$(Item, { key: 'set2' }, 'Option Two')
		)
	);
};

export default Header;
